  List<Widget> GetProducts(List<product> Productlist2) {
    List<Widget> product = [];

    for (var item in Productlist2) {
      product.add(ElevatedButton(
        style: ElevatedButton.styleFrom(
          side: const BorderSide(
            width: 1.0,
            color: Colors.black,
          ),
          primary: Colors.white,
          //shape: RoundedRectangleBorder( borderRadius: BorderRadius.circular(20.0),side: const BorderSide(color: Colors.white),)
        ),
        onPressed: () {
          ScaffoldMessenger.of(context).hideCurrentSnackBar();
          int posicion = carrito.indexOf(item);
          if (posicion == -1) {
            carrito.add(item);
            cantidadCarrito.add(1);
          } else {
            cantidadCarrito[posicion] = cantidadCarrito[posicion] + 1;
          }
          //print(carrito);
          //print(cantidadCarrito);
          final snackBar = SnackBar(
            content: Text(item.name! + " agregado correctamente"),
            duration: Duration(seconds: 1),
          );
          ScaffoldMessenger.of(context).showSnackBar(snackBar);
          setState(() {
            cantidadProductosCarrito = cantidadProductosCarrito + 1;
          });
        },
        child: Column(
          crossAxisAlignment: CrossAxisAlignment.center,
          mainAxisAlignment: MainAxisAlignment.center,
          children: [
            Expanded(child: BringImage(item.image)),
            Container(
              child: Text(
                item.name!,
                style: const TextStyle(
                    color: Colors.black,
                    fontWeight: FontWeight.bold,
                    fontSize: 17),
              ),
            ),
            Container(
              child: Text(
                String.fromCharCode(36) + (item.price!).toString(),
                style: const TextStyle(
                    color: Colors.black,
                    fontWeight: FontWeight.bold,
                    fontSize: 17),
              ),
            ),
            //Image.asset('assets/Gas.png',),
          ],
        ),
      ));
    }
    return product;
  }

  Widget BringImage(String? image) {
    if (image != null && image != "" && image.isNotEmpty) {
      var _byteImage = Base64Decoder().convert(image);
      Widget? imageHere = Image.memory(_byteImage);
      return imageHere;
    } else {
      return const Text("");
    }
  }

