    Future<void> getRequest() async {

    //encode Map to JSON
    final response = await http.get(
        Uri.parse('https://v7m9qx5n3k.execute-api.us-east-1.amazonaws.com/Test/products'),
        headers: {
          'Content-Type': 'application/json',
        });
    print(response);
    final responseJson = jsonDecode(response.body);

    print(responseJson);
    setState(() {
      for (var response in responseJson) {
        product productoT= product(
          code: response['code'],
          name: response['name'],
          category: response['category'],
          price: double.parse(response['price']),
          image:response['image']
        );
        ProductlistOriginal.add(productoT);
      }
    });
    print(ProductlistOriginal);
  }

  List<Widget> GetCategories(){
    List<Widget> ListaDeCategoriasWidget=[];
    List<String> ListaDeCategoriasItems=[];

    for (var item in ProductlistOriginal) {
      if((ListaDeCategoriasItems).indexOf(item.category!)==-1)
      {
        ListaDeCategoriasItems.add(item.category!);
        ListaDeCategoriasWidget.add(InkWell(
              child: Container(
                margin: EdgeInsets.only(top: 4),
                padding: EdgeInsets.all(20),
                width: double.infinity,
                color: Colors.indigo.shade800,
                child: Text(item.category!,
                    style: TextStyle(color: Colors.white, fontSize: 15)),
              ),
              onTap: () {
                setState(() {
                  GetProductsByCategory(item.category!);//aqui mandara a llamara al metodo para filtrar por categoria
                  _searchTextField.text = item.category!;
                  Navigator.pop(context);
                });
              },
            ));
      }
    }
    return ListaDeCategoriasWidget;
  }

  GetProductsByCategory (String category) {
    
    List<product> ListaFiltrada = [];
    setState(() {
      for (var item in ProductlistOriginal) {
        if (((item.category!).toLowerCase())
            .contains((category).toLowerCase())) {
          ListaFiltrada.add(item);
        }
      }
    });
    setState(() {
      Productlist = ListaFiltrada;
    });
    
  }


    //Guardar el valor del inicio de sesion en cache
  _GuardarValorInicioSesion(String sesionIniciada) async {
    final SharedPreferences prefs = await SharedPreferences.getInstance();
    setState(() {
      prefs.setString("sesion", sesionIniciada);
    });
  }

    //obtener de la cache el usuario
  Future<String> _GetUser() async {
    final SharedPreferences prefs = await SharedPreferences.getInstance();
    return prefs.getString("UseName") ?? "";
  }


  Checkout () async {

      await postRequestPurchase();
      setState(() {
        carrito.clear();
        cantidadCarrito.clear();
        cantidadProductosCarrito = 0;
