    Future<void> postRequestPurchase() async {
    //ramdom numbers
    String RandomString="";
    var rng = new Random(); 
    for (var i = 0; i < 10; i++) 
    { RandomString=RandomString+(rng.nextInt(100)).toString(); }

    String total=(calcularMontoTotal()).toString();

    DateTime now = DateTime.now();
    String formattedDate = DateFormat('dd/MM/yyyy kk:mm:ss').format(now.add(Duration(hours: -05)));  

    String user=await _GetUser();

    print(RandomString+'   '+total+'   '+formattedDate+'   '+user);

    Map data = {
      'Clave': RandomString,
      'Amount': total, //deviceId,
      'Date': formattedDate,
      'User': user
    };
    var body = json.encode(data);

    //encode Map to JSON
    final response = await http.post(
        Uri.parse('https://v7m9qx5n3k.execute-api.us-east-1.amazonaws.com/Test/compras'),
        headers: {
          'Content-Type': 'application/json',
        },
        body: body);
    print(response);
    //final responseJson = jsonDecode(response.body);

    if (response.statusCode == 200) {
      print(response);
      print("Compra guardada corretamente");
      //guaradar productos en la compra
      await postRequestProductsXPurchase(RandomString, user);
      showDailogMessage(context, "Compra finalizada correctamete");
    }
    else
    {
      print("Error");
      showDailogMessage(context, "Error al comprar");
    }
  }

  Future<void> postRequestProductsXPurchase(String RandomString, String user) async {

    for (var i=0; i<carrito.length; i++) {
      //ramdom numbers
      String RandomString2="";
      var rng = new Random(); 
      for (var i = 0; i < 10; i++) 
      { RandomString2=RandomString2+(rng.nextInt(100)).toString(); }

      Map data = {
        'Clave': RandomString2,
        'ClaveCompra': RandomString, //deviceId,
        'ProductCode': carrito[i].code,
        'quantity': (cantidadCarrito[i]).toString(),
        'User': user
      };
      var body = json.encode(data);

      //encode Map to JSON
      final response = await http.post(
          Uri.parse('https://v7m9qx5n3k.execute-api.us-east-1.amazonaws.com/Test/productoxcompra'),
          headers: {
            'Content-Type': 'application/json',
          },
          body: body);
      print(response);
      //final responseJson = jsonDecode(response.body);

      if (response.statusCode == 200) {
        print(response);
        print("Producto guardado corretamente"+carrito[i].code!);
      }
      else
      {
        print("Error");
        showDailogMessage(context, "Error al comprar");
      }
    }
  }

